ations\n    std_dev_windspeed = Math.sqrt(std_dev_windspeed)\n    \n    d2[\"ws_std\"].push(std_dev_windspeed.toFixed(2))\n    turb_int = std_dev_windspeed / avg_windspeed\n    d2[\"turb_int\"].push(turb_int.toFixed(2))\n    \n    /*\n    DEBUGGING\n    console.log(\"STD DEV WS \" + std_dev_windspeed)\n    console.log(\"Turb int \" + turb_int)\n    console.log(\"WS Vals \" + foo)\n    */\n    \n    //Calculate linear regression slope from selection\n    var lr = {};\n    var sum_x = 0;\n    var sum_y = 0;\n    var sum_xy = 0;\n    var sum_xx = 0;\n    var sum_yy = 0; \n    \n\n    //Use the selected elapsed time entries as the x values for linear regr\n    for (let x in inds)\n    {\n        x_regr.push(d1[\"x_for_regression\"][inds[x]])\n        y_regr.push(d1[\"alt\"][inds[x]])\n    }\n\n    \n    //Reference https://stackoverflow.com/questions/6195335/linear-regression-in-javascript#6195354\n    for (let i = 0; i &lt; inds_length; i++) \n    {\n        sum_x += x_regr[i];\n        sum_y += y_regr[i];\n        sum_xy += (x_regr[i]*y_regr[i]);\n        sum_xx += (x_regr[i]*x_regr[i]);\n        sum_yy += (y_regr[i]*y_regr[i]);\n    }\n    \n    lr['slope'] = ((inds_length * sum_xy) - (sum_x * sum_y)) / ((inds_length*sum_xx) - (sum_x * sum_x));\n    d2[\"aog_slope\"].push(lr[\"slope\"].toFixed(5))\n    \n    \n    /*\n    //FOR SLOPE VISUALIZATION\n    //lr['intercept'] = (sum_y - lr.slope * sum_x)/inds_length;      \n    //Predict from selection\n    for (let i = 0; i &lt; inds_length; i++)\n    {\n        d3[\"x\"].push(d1[\"datetime\"][inds[i]])\n        y_predict[i] = lr[\"intercept\"] + (lr[\"slope\"] * x_regr[i])\n        d3[\"y\"].push(y_predict[i])\n    }\n    */\n    \n    //Display the range selection\n    ranges.text = \"SELECTED INDICES: \" + inds[0] + \" - \" + inds[inds.length-1]\n    \n    /*\n    //DEBUGGING    \n    console.log(\"X for slope \" + x_regr) \n    console.log(\"Slope \" + lr[\"slope\"])\n    console.log(\"Intercept \" + lr[\"intercept\"])\n    console.log(\"Predicted values \" + y_predict)\n    console.log(\"Xs for slope viz \" + d3[\"x\"])\n    */\n    \n    statistics.change.emit()\n    //regr.change.emit()\n    \n"},"id":"1221718","type":"CustomJS"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"magenta"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"magenta"},"height":{"value":0.5},"left":{"value":1673626708000.0},"line_alpha":{"value":0.1},"line_color":{"value":"magenta"},"right":{"value":1673626708000.0},"y":{"value":-1}},"id":"2646522","type":"HBar"},{"attributes":{},"id":"1678427","type":"Selection"},{"attributes":{"fill_color":{"value":"magenta"},"hatch_color":{"value":"magenta"},"height":{"value":0.5},"left":{"value":1673626708000.0},"line_color":{"value":"magenta"},"right":{"value":1673626708000.0},"y":{"value":-1}},"id":"2646521","type":"HBar"},{"attributes":{},"id":"1897444","type":"UnionRenderers"},{"attributes":{},"id":"2646515","type":"Selection"},{"attributes":{"fill_color":{"value":"#425DC9"},"hatch_color":{"value":"#425DC9"},"height":{"value":0.5},"left":{"value":1673625894000.0},"line_color":{"value":"#425DC9"},"right":{"value":1673625894000.0},"y":{"value":1}},"id":"1896013","type":"HBar"},{"attributes":{"data":{},"selected":{"id":"1897445"},"selection_policy":{"id":"1897444"}},"id":"1896012","type":"ColumnDataSource"},{"attributes":{},"id":"2601894","type":"UnionRenderers"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#425DC9"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"#425DC9"},"height":{"value":0.5},"left":{"value":1673625894000.0},"line_alpha":{"value":0.1},"line_color":{"value":"#425DC9"},"right":{"value":1673625894000.0},"y":{"value":1}},"id":"1896014","type":"HBar"},{"attributes":{"fill_color":{"value":"#43a2ca"},"hatch_color":{"value":"#43a2ca"},"left":{"value":1673626666000.0},"line_color":{"value":"#43a2ca"},"right":{"value":1673626666000.0},"y":{"value":1}},"id":"2599691","type":"HBar"},{"attributes":{"data":{},"s
